import React from "react";
import { Link } from "react-router-dom";
import "./Header.css";

function Header() {
  return (
    <header>
      <img
        src="https://wallpaperplay.com/walls/full/7/f/8/109614.jpg"
        alt="nba-logo"
        className="logo"
      />

      <ui>
        <li className="options">
          <Link to="/">Home</Link>
        </li>
        <li className="options">
          <Link to="/Menu">Game Menu</Link>
        </li>
      </ui>
    </header>
  );
}

export default Header;
